// Only show if the description is not null/whitespace etc.
// https://stackoverflow.com/questions/10232366
v2((data) => {
  const str = data.Description;
  return str === null || (/^\s*$/).test(str);
});

// Only show if the description is not null/whitespace AND data.DescriptionExtended is empty
v2((data) => {
  const detailsBlank = data.DescriptionExtended == '';
  const title = data.Description;
  const titleBlank = title == null || (/^\s*$/).test(title);
  return detailsBlank && !titleBlank;
});

