v1(data, context) {
  var partMsg = function(target, value) {
    if (value == -1) return target + ' 🚫';
    return target + ' ' + value + 's';
  }
  var msg = '';
  if (!data.IsEnabled)
    return '🚫';
  msg = '✅ - ';
  msg += partMsg('Users', data.Duration);
  msg += ', ' + partMsg('Reg', data.DurationUsers);
  msg += ', ' + partMsg('Editors', data.DurationEditors);
  msg += ', ' + partMsg('SysAdmins', data.DurationSystemAdmin);
  return msg;
}

v1(data, context) {
  if (context.cache.alreadyRun) return data.value;
  context.cache.alreadyRun = true;
  const enabled = context.features.isEnabled('LightSpeedOutputCache');
  // console.log("enabled", enabled);
  return !enabled;
}

