v1(data, context) {
  const empty = 'empty';
  const len = 30;
  // Remove HTML in note
  const noHtml = data.Note.replace(/<\/?[^>]+(>|$)/g, ' ');
  if (!noHtml || noHtml == ' ') return empty;

  // remove html things like &nbsp;
  const converterTextArea = context.cache.converter 
    || document.createElement("textarea");
  converterTextArea.innerHTML = noHtml;
  const cleanText = converterTextArea.value;

  // Trim multiple spaces, created by multiple tags
  var final = cleanText.replace(/\s+/g, ' ').trim();

  if (!final) return empty;

  if (final.length > len) final = final.substring(0, len) + "..."
  return final || empty;
}
